        new_grid = np.zeros((4, 4), dtype=int)
        merged = np.zeros((4, 4), dtype=bool)
        for col in range(4):
            non_zero = grid[:, col][grid[:, col] != 0]
            for i in range(len(non_zero)):
                if i > 0 and non_zero[i] == non_zero[i - 1] and not merged[i - 1, col]:
                    new_grid[i - 1, col] = non_zero[i] * 2
                    self.score += non_zero[i] * 2
                    merged[i - 1, col] = True
